import React from 'react';
import {Container,Row,Button} from 'reactstrap'
import { NavLink,Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';
const nav__links=[
        {
            path:'/home',
            diaplay:'Home'
        },
        {
            path:'#',
            diaplay:'About'
        },
        {
            path:'/tours',
            diaplay:'Tours'
        },
    ]
const Header = () => {
    return <header className='header'>
        <Container>
     <Row>
         <div className='nav__wrapper d-flex align align-items-center justify-content-between'>
            {/*===========logo==========*/}
            <div className='logo'>
                 <img src={logo} alt="Logo"/>
             </div>
              {/*===========logo end==========*/}
         </div>
     </Row>
    </Container>
     </header>
}

export default Header;

